Rules.InvariantScript:
Set(gvar_startWith, Now());

ClearCollect(
    col_AnimeResultsWith,
    ForAll(
        col_Anime,
        With(
            {
                userData: LookUp(col_Users, Email = "otaku@anime.com"),
                budgetData: LookUp(col_GenreBudgets, Genre = Genre)
            },
            {
                AnimeID: AnimeID,
                Title: Title,
                Genre: Genre,
                Episodes: Episodes,
                Rating: Rating,
                Reviewer: userData.Name,
                ReviewerRole: userData.Role,
                Budget: budgetData.Budget,
                Score: Round((Rating * Episodes) + budgetData.Budget/1000, 2)
            }
        )
    )
);

Set(gvar_endWith, Now());
Set(gvar_timeWith, DateDiff(gvar_startWith, gvar_endWith, TimeUnit.Milliseconds));

ControlPropertyState.AutoRuleBindingString:
Set(startTime, Now());

Set(
    subtotal,
    Sum(colProducts, Price * Quantity)
);
Set(
    discounted,
    subtotal * 0.9
);
Set(
    finalTotal,
    discounted * 1.2
);

Set(endTime, Now());
Set(lblSetResult, finalTotal);
Set(lblSetElapsed, DateDiff(startTime, endTime,TimeUnit.Milliseconds));

